const reporting = require('zigbee-herdsman-converters/lib/reporting');
const exposes = require('zigbee-herdsman-converters/lib/exposes');
const e = exposes.presets;
const ea = exposes.access;
const {
    battery,
    binary,
    enumLookup,
    numeric,
    pressure,
    temperature,
    deviceEndpoints,
} = require('zigbee-herdsman-converters/lib/modernExtend');

const oneReporting = {min: 45, max: 1800, change: 1};
const twoReporting = {min: 45, max: 1800, change: 10};
const threeReporting = {min: 30, max: 1800, change: 1};
const fourReporting = {min: 30, max: 1800, change: 10};
const fiveReporting = {min: 1800, max: 10600, change: 1};
const sixReporting = {min: 3600, max: 21600, change: 1};

const fzLocal = {
node_config6: {
        cluster: 'genBasic',
        type: ['attributeReport', 'readResponse'],
        convert: (model, msg, publish, options, meta) => {
            const result = {};
			if (msg.data.hasOwnProperty(0xA19B)) {
                result.sensor_identifier = msg.data[0xA19B];
            }
            return result;
        },
    },
	};

const definition = {
    zigbeeModel: ['EFEKTA_PST_V1'],
    model: 'EFEKTA_PST_V1',
    vendor: 'EFEKTA',
    description: '[Smart water/gas pressure monitor.](http://efektalab.com/PST_v1)',
	fromZigbee: [fzLocal.node_config6],
    icon: 'data:image/png;base64,',
            extend: [
            //deviceEndpoints({endpoints: {'1': 1, '2': 2}}),
            pressure({
                //endpointNames: ['1'],
                unit: 'kPa',
                description: 'pressure in kPa',
                scale: 10,
                reporting: threeReporting,
                access: 'STATE',
            }),
            numeric({
                //endpointNames: ['1'],
                name: 'bar',
                unit: 'bar',
                cluster: 'msPressureMeasurement',
                attribute: 'measuredValue',
                description: 'pressure in bar',
                scale: 1000,
                precision: 2,
                access: 'STATE',
            }),
            numeric({
                //endpointNames: ['1'],
                name: 'psi',
                unit: 'psi',
                cluster: 'msPressureMeasurement',
                attribute: 'measuredValue',
                description: 'pressure in bar',
                scale: 68.94757,
                precision: 2,
                access: 'STATE',
            }),
            temperature({
                //endpointNames: ['2'],
                description: 'Measured value of the first temperature sensor',
                reporting: fourReporting,
                access: 'STATE',
            }),
            numeric({
                endpointName: 1,
                name: 'pressure_offset',
                unit: 'kPa',
                valueMin: -100.0,
                valueMax: 100.0,
                cluster: 'msPressureMeasurement',
                attribute: {ID: 0x0210, type: 0x29},
                description: 'Adjust first pressure sensor',
            }),
            numeric({
                //endpointNames: ['2'],
                name: 'raw_temperature_cal',
                unit: 'raw unit',
                valueMin: -8192,
                valueMax: 8192,
                cluster: 'msTemperatureMeasurement',
                attribute: {ID: 0x0008, type: 0x29},
                description: 'Adjust temperature sensor',
            }),
			numeric({
				//endpointNames: ['2'],
                name: 'raw_temperature',
                unit: 'raw unit',
                cluster: 'msTemperatureMeasurement',
                attribute: {ID: 0x0007, type: 0x29},
                description: 'Sensor raw temperature',
                access: 'STATE',
            }),
			numeric({
				//endpointNames: ['2'],
                name: 'raw_temperature_recal',
                unit: 'raw unit',
                cluster: 'msTemperatureMeasurement',
                attribute: {ID: 0x0009, type: 0x29},
                description: 'Recalibrated sensor raw temperature',
                access: 'STATE',
            }),
            battery({
                voltage: true,
                voltageReporting: true,
                lowStatus: true,
                percentageReportingConfig: fiveReporting,
                voltageReportingConfig: sixReporting,
            }),
            numeric({
                name: 'uptime',
                unit: 'Hours',
                cluster: 'genTime',
                attribute: 'localTime',
                description: 'Uptime',
                scale: 3600,
                precision: 1,
                access: 'STATE',
            }),
            numeric({
                name: 'reading_interval',
                unit: 'sec',
                valueMin: 5,
                valueMax: 360,
                cluster: 'genPowerCfg',
                attribute: {ID: 0x0201, type: 0x21},
                description: 'Setting the sensor reading interval in seconds, by default 15 seconds',
            }),
            enumLookup({
                name: 'tx_radio_power',
                lookup: {'0': 0, '4': 4},
                cluster: 'genPowerCfg',
                attribute: {ID: 0x0236, type: 0x28},
                description: 'Set TX Radio Power, dbm',
            }),
            binary({
                name: 'pool_rate_on',
                valueOn: ['ON', 1],
                valueOff: ['OFF', 0],
                cluster: 'genPowerCfg',
                attribute: {ID: 0x0216, type: 0x10},
                description: 'Enable Smart Sleep, short wakeup every 7 seconds',
            }),
            binary({
                name: 'config_report_enable',
                valueOn: ['ON', 1],
                valueOff: ['OFF', 0],
                cluster: 'genPowerCfg',
                attribute: {ID: 0x0275, type: 0x10},
                description: 'Enable reporting based on reporting configuration',
            }),
            binary({
                name: 'comparison_previous_data',
                valueOn: ['ON', 1],
                valueOff: ['OFF', 0],
                cluster: 'genPowerCfg',
                attribute: {ID: 0x0205, type: 0x10},
                description: 'Enable сontrol of comparison with previous data',
            }),
        ],
        configure: async (device, coordinatorEndpoint, logger) => {
            const endpointOne = device.getEndpoint(1);
            const overrides0 = {min: 7200, max: 43200, change: 1};
            await reporting.batteryAlarmState(endpointOne, overrides0);
        },
		exposes: [
		exposes.numeric('sensor_identifier', ea.STATE).withDescription('Sensor type, identifier')
		],
};

module.exports = definition;